var testCon = $('#row');

var autoAppImg = (list, gal) => {
    // create a for loop to loop through all of the links
    for (var i = 0; i < list.length; i++) {
        // if the link container -s at the end of the string print container with column width 2 else just print a div with the link at the background
        // check if link containes -no-s
        let linkUnCut = list[i];
        // if true delete the -s at the end of the string
        if (linkUnCut.includes('-no-s') === true ){
            let start = 0;
            let end = linkUnCut.length - 2;
            let linkCut = linkUnCut.substring(start, end);
            let divCon = "<div class='item col-lg-2 col-md-3 col-sm-3 col-xs-12'><div class='item-content'><img src='" + linkCut + "'></div></div>";
            // now that you have the link create a muuri div
            gal.append(divCon);
        } else {
            let link = linkUnCut;
            let divCon = "<div class='item col-lg-4 col-md-6 col-sm-6 col-xs-12'><div class='item-content'><img src='" + link + "'></div></div>";
            // append to muuri grid
            gal.append(divCon);
        };
    };

};

// store path name of loaded page
var isPath = window.location.pathname;

if (isPath === '/new-world-website/gallery/students.html'){
    autoAppImg(listStud, galStud);
} else if (isPath === '/new-world-website/gallery/teaching.html') {
    autoAppImg(listTeach, galTeach);
} else if (isPath === '/new-world-website/gallery/volunteers.html') {
    autoAppImg(listVol, galVol);
} else if (isPath === '/new-world-website/gallery/newworld.html') {
    autoAppImg(listNewworld, galNewworld);   
    // console.log('on new world page')
} else if (isPath === '/new-world-website/gallery/travel.html') {
    autoAppImg(listTrav, galTravel);
} else if (isPath === '/new-world-website/gallery/thehouse.html') {
    autoAppImg(listHouse, galHouse);
};